    [],nt"revision_timestamp": "2016-05-25T00:53:03.903605",nt"name": "weather-message-switching-center-replacement",nt"isopen":
    true,nt"url": null,nt"notes": "The Weather Message Switching Center Replacement
    (WMSCR) is the primary National Airspace System (NAS) interface with the National
    Weather Service (NWS) Telecommunications Gateway (NWSTG) for the exchange of aviation
    alphanumeric and limited gridded weather products.  WMSCR collects, processes, stores,
    and disseminates aviation weather products to major NAS systems, the airlines, and
    international and commercial users.  WMSCR also provides storage and distribution
    of domestic Notice To Airmen (NOTAM) data and retrieval of international NOTAMs
    through the Consolidated NOTAM System (CNS).",nt"license_title": "Other License
